import React from 'react';

function Footer() {
  return (
    <footer>
      <a href="https://github.com/developer" target="_blank" rel="noopener noreferrer">GitHub</a>
      <a href="https://linkedin.com/in/developer" target="_blank" rel="noopener noreferrer">LinkedIn</a>
